INSERT INTO `news` (`id_news`, `titre`, `texte`, `date`, `id_admin`) VALUES
(2, 'Cristiano Ronaldo marque son 800e but en carrière', 'Cristiano Ronaldo, l\'une des légendes vivantes du football, a franchi une nouvelle étape historique en marquant son 800e but en carrière lors d\'un match de Serie A avec la Juventus. Cette réalisation remarquable confirme son statut d\'un des meilleurs buteurs de tous les temps.', '2024-04-11', 1),
(3, 'Le Paris Saint-Germain remporte la Ligue des Champions', 'Après des années de domination nationale et d\'efforts constants pour conquérir l\'Europe, le Paris Saint-Germain a finalement remporté la Ligue des Champions. Sous la direction de leur entraîneur récemment nommé, le club parisien a montré une performance éblouissante pour décrocher ce prestigieux titre.', '2024-04-17', 1),
(4, 'Un scandale de corruption secoue la FIFA ', 'Une nouvelle enquête sur des allégations de corruption au sein de la FIFA a éclaté, mettant en cause plusieurs hauts responsables du football mondial. Les révélations choquantes ont jeté une lumière crue sur les pratiques controversées et ont entraîné des appels à une réforme profonde au sein de l\'organisation dirigeante du football mondial.', '2024-04-18', 1);

