INSERT INTO `terrain` (`id_terrain`, `nom_terrain`, `description`, `image`, `prix`) VALUES
(1, 'Terrain Stih', 'Notre terrain offre une surface de jeu en pelouse naturelle parfaitement entretenue, offrant aux joueurs une expérience de jeu fluide et agréable. Avec son excellente aération, ce terrain est idéal pour des matchs rapides et dynamiques, permettant aux joueurs de donner le meilleur d\'eux-mêmes tout au long du jeu.', , 40);
INSERT INTO `terrain` (`id_terrain`, `nom_terrain`, `description`, `image`, `prix`) VALUES
(2, 'Terrain Balasat', 'Doté d\'une surface en gazon synthétique de haute qualité, notre terrain offre une résistance exceptionnelle et une polyvalence inégalée. Que ce soit pour des matchs amicaux entre amis ou des tournois officiels, ce terrain garantit des conditions de jeu optimales, quelle que soit la météo, tout en réduisant les risques de blessures grâce à son amorti intégré.', , 60);
INSERT INTO `terrain` (`id_terrain`, `nom_terrain`, `description`, `image`, `prix`) VALUES
(3, 'Terrain Malja', 'Notre terrain indoor propose une expérience de jeu unique, permettant aux joueurs de profiter du football toute l\'année, quel que soit le temps à l\'extérieur. Avec son revêtement de sol innovant et ses installations de pointe, ce terrain offre un environnement confortable et sécurisé pour des matchs passionnants, que ce soit pour des entraînements réguliers ou des événements spéciaux.', , 50);
INSERT INTO `terrain` (`id_terrain`, `nom_terrain`, `description`, `image`, `prix`) VALUES
(4, 'Terrain EL Hay ', 'Terrain de football en gazon naturel situé au cœur de la ville. Doté d\'une surface parfaitement entretenue, ce terrain offre un cadre idéal pour des matchs dynamiques et compétitifs. Les dimensions réglementaires du terrain permettent une pratique optimale du football, que ce soit pour des entraînements réguliers ou des compétitions officielles. Avec ses installations modernes et son ambiance conviviale, ce terrain est un lieu de rencontre incontournable pour les amateurs de football de tous niveaux.', , 35);

