INSERT INTO `tournois` (`id_tournoi`, `nom_tournoi`, `date_debut`, `date_fin`, `description`, `id_terrain`, `nb_equipe`, `nb_equipe_restant`, `prix`) VALUES
(1, 'Maracana', '2024-04-11', '2024-04-13', 'Rejoignez-nous pour un tournoi de football amical et passionnant organisé au cœur de nos quartiers. Avec une ambiance conviviale et des équipes de toutes les générations, ce tournoi offre une occasion idéale de se réunir, de partager des moments de sport et de renforcer les liens communautaires. Que vous soyez un joueur expérimenté ou un novice, venez vous amuser et montrer vos talents sur le terrain !', 2, 8, 10, 150),
(2, 'Scisilia', '2024-04-30', '2024-05-15', 'Participez à notre tournoi de football inter facultés et représentez fièrement votre faculté sur le terrain ! Ouvert à tous les étudiants de l\'université, ce tournoi offre une compétition féroce et amicale entre les différentes facultés. Rencontrez de nouveaux amis, rivalisez dans un esprit sportif et vivez des moments inoubliables pendant cette journée de football universitaire !', 1, 12, 12, 120),
(3, 'Hooligans', '2024-04-16', '2024-04-22', 'Rejoignez-nous pour un tournoi de football spécial en soutien à des œuvres caritatives locales ! Réunissant des équipes de toutes les horizons, ce tournoi vise à collecter des fonds pour des causes importantes tout en offrant une journée de plaisir et de compétition sur le terrain. Chaque but marqué contribue à faire une différence dans la vie des personnes dans le besoin. Venez jouer, soutenir une bonne cause et faire une différence dans votre communauté!', 3, 12, 12, 100);

